import React,{useContext} from 'react'
import { AppState,DepositState,BalanceState,WithdrawState } from '../App'
import './UserInfo.css'
const UserInfo = () => {
  const {userInfo} = useContext(AppState)
  const {amountDeposit} = useContext(DepositState)
  const {amountWithdraw} = useContext(WithdrawState)
  const {amountBalance} = useContext(BalanceState)
  return (
    <div>

        <div className='user__info'>

            <h2 className='user__title'> User Information</h2>
            <div>
                <h3 className='user__contents'>Name <span className=''>{userInfo.Fname} {UserInfo.Lname}</span></h3>
                <h3 className='user__contents'>Phone <span>{userInfo.phone}</span></h3>
                <h3 className='user__contents'>Id <span>{userInfo.id}</span></h3>
                <h3 className='user__contents'>Email <span>{userInfo.email}</span></h3>
                <h3 className='user__contents'>Deposited Amount <span> {amountDeposit.deposit} </span></h3>
                <h3 className='user__contents'>WithDraw Amount  <span> {amountWithdraw.withdraw} </span></h3>
                <h3 className='user__contents'>Balance <span>{amountBalance.balance} </span></h3>
            </div>
        </div>



    </div>
  )
}

export default UserInfo
